        key = winreg.OpenKey(winreg.HKEY_CURRENT_USER,r'Software\Microsoft\Windows\CurrentVersion\Explorer\Shell Folders')
        self.desktop =  winreg.QueryValueEx(key, "Desktop")[0] 
        self.encrypted_files_folder =  winreg.QueryValueEx(key, "Local AppData")[0]
